import React from 'react'
import logo from '../images/logo.png'
const Navbar = () => {
  return (
    <div>
        <nav className='bg-bgDark py-2 flex'>
            <img src={logo} height='25px'></img>
            <div className='text-white text-2xl font-bold items-center'>InfoCon</div>
        </nav>
    </div>
  )
}

export default Navbar
